import React from 'react';
import Wheel from './wheel.js';

const WheelOfFortune = (props) => {
  return(
    <div>
      <Wheel/>
      <button onClick={() => props.generateWinner()}>Get Winner</button>
    </div>
  )
}

export default WheelOfFortune;
